import React, { useState } from 'react';
import './index.css';
import { Link } from "react-router-dom";
import cricketLogo from './images/5492.jpg';

const HomePage = () => {
    const [team1, setTeam1] = useState('');
    const [team2, setTeam2] = useState('');
    const [team1Name, setTeam1Name] = useState('');
    const [team2Name, setTeam2Name] = useState('');
    const [prediction, setPrediction] = useState(''); // State to store prediction result

    // Win percentage data for each team against other teams
    const winPercentages = {
        "CSK": {
            "MI": 40,
            "RCB": 65.63,
            "DC": 60,
            "KKR": 55,
            "PBKS": 58,
            "RR": 55,
            "SRH": 57,
            "LSG": 50,
            "GT": 33
        },
        "MI": {
            "CSK": 54.05,
            "DC": 54.28,
            "KKR": 67.64,
            "PBKS": 53.12,
            "RR": 51.72,
            "RCB": 57.58,
            "SRH": 56.52,
            "LSG": 16.67,
            "GT": 40.00
        },
        "RCB": {
            "CSK": 34.37,
            "MI": 42.42,
            "DC": 50,
            "KKR": 45.2,
            "PBKS": 48.12,
            "RR": 50,
            "SRH": 49.8,
            "LSG": 55.1,
            "GT": 41.9
        },
        "KKR": {
            "CSK": 45,
            "MI": 32.36,
            "RCB": 54.8,
            "DC": 50,
            "PBKS": 52.4,
            "RR": 47.9,
            "SRH": 56.5,
            "LSG": 60.5,
            "GT": 48.5
        },
        // Add other teams' data...
    };

    const selectTeam = (teamImg, teamName) => {
        if (!team1) {
            setTeam1(`${teamImg}.jpg`);
            setTeam1Name(teamName);
        } else if (!team2) {
            if (teamImg === team1) {
                alert("Please select a different team for prediction.");
            } else {
                setTeam2(`${teamImg}.jpg`);
                setTeam2Name(teamName);
            }
        } else {
            alert("You have already selected two teams. Please reset to choose again.");
        }
    };

    const clearSelections = () => {
        setTeam1('');
        setTeam2('');
        setTeam1Name('');
        setTeam2Name('');
        setPrediction(''); // Clear prediction state
    };

    const makePrediction = () => {
        if (!team1Name || !team2Name) {
            alert("Please select both teams to make a prediction!");
            return;
        }

        const team1WinPercentage = winPercentages[team1Name][team2Name];
        const team2WinPercentage = winPercentages[team2Name][team1Name];

        let predictionResult = '';
        if (team1WinPercentage > team2WinPercentage) {
            predictionResult = `${team1Name} is predicted to win with a win percentage of ${team1WinPercentage}%!`;
            alert(predictionResult);
        } else if (team2WinPercentage > team1WinPercentage) {
            predictionResult = `${team2Name} is predicted to win with a win percentage of ${team2WinPercentage}%!`;
            alert(predictionResult);
        } else {
            predictionResult = `It's a close match! Both teams have similar chances of winning.`;
            alert(predictionResult);
        }

        setPrediction(predictionResult); // Update the prediction state
    };

    return (
        <div>
            {/* Navbar */}
            <nav className="navbar navbar-expand-lg bg-body-tertiary">
                <div className="container-fluid navbar-color">
                    <Link className="navbar-brand mr-5n" to="#">
                        <img src={cricketLogo} className="navbar-image" alt="Cricket Logo" />
                    </Link>
                    <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav">
                        <span className="navbar-toggler-icon"></span>
                    </button>
                    <div className="collapse navbar-collapse" id="navbarNav">
                        <ul className="navbar-nav ms-auto">
                            <li className="nav-item"><Link className="nav-link active" to="#">Home</Link></li>
                            <li className="nav-item"><Link className="nav-link" to="#">TEAMS</Link></li>
                            <li className="nav-item"><Link className="nav-link" to="07venue.html">VENUE</Link></li>
                            <li className="nav-item"><Link className="nav-link" to="#about-us">ABOUT US</Link></li>
                            <li className="nav-item"><Link className="nav-link" to="01login.html">Login</Link></li>
                        </ul>
                    </div>
                </div>
            </nav>

            {/* Team Selection */}
            <div className="container team-container bc">
                <h2 className="text-center mb-4">Select Two IPL Teams</h2>
                <div className="row">
                    {['CSK', 'MI', 'RCB', 'KKR', 'SRH', 'RR', 'DC', 'GT', 'LSG', 'PBKS'].map((team, index) => (
                        <div key={index} className="col-md-4">
                            <div className={`team ${team}`} onClick={() => selectTeam(team, team)}>
                                <div className="team-name textStyle">{team}</div>
                            </div>
                        </div>
                    ))}
                </div>
            </div>

            {/* Selected Teams Display */}
            <div className="container text-center mt-4">
                <h4>Selected Teams:</h4>
                <div className="d-flex justify-content-center align-items-center">
                    <div className={`selected-team ${team1Name}`}>
                        <div className="team-name">{team1Name}</div>
                    </div>
                    <div className="vs">VS</div>
                    <div className={`selected-team ${team2Name}`}>
                        <div className="team-name">{team2Name}</div>
                    </div>
                </div>
                <button onClick={makePrediction} className="btn btn-primary mt-4" disabled={!team1 || !team2}>Make Prediction</button>
                <button onClick={clearSelections} className="btn btn-secondary mt-4" disabled={!team1 && !team2}>Clear</button>

                {/* Display Prediction Result */}
                {prediction && <div className="prediction-result mt-4">{prediction}</div>}
            </div>

            {/* Footer */}
            <footer className="footer" id="about-us">
                <div className="row">
                    <div className="footer-col">
                        <h4>Company</h4>
                        <ul>
                            <li><Link to="#">About Us</Link></li>
                            <li><Link to="#">Contact</Link></li>
                        </ul>
                    </div>
                    <div className="footer-col">
                        <h4>Get Help</h4>
                        <ul>
                            <li><Link to="#">FAQ</Link></li>
                            <li><Link to="#">Support</Link></li>
                        </ul>
                    </div>
                    <div className="footer-col">
                        <h4>Follow Us</h4>
                        <div className="social-links">
                            <Link to="#"><i className="fab fa-facebook-f"></i></Link>
                            <Link to="#"><i className="fab fa-twitter"></i></Link>
                            <Link to="#"><i className="fab fa-instagram"></i></Link>
                        </div>
                    </div>
                </div>
            </footer>
        </div>
    );
};

export default HomePage;
